svg.script:
function init(){
	var all = document.getElementsByTagName("*");
	for (var i=0, max=all.length; i < max; i++) 
	{
		fitShapeLengthForMarkers(all[i]);
	}
}


function fitShapeLengthForMarkers(shape){
	if ((shape.nodeName != "path" && shape.nodeName != "line" && shape.nodeName != "polyline") ||
		(shape.parentNode && shape.parentNode.nodeName != "g" && shape.parentNode.nodeName != "svg"))
	{
		return;
	}

	// calc length
	var length = 0;
	if (shape.nodeName == "path") length = shape.getTotalLength();
	else if (shape.nodeName == "line")  length = Math.sqrt(Math.pow(shape.x2.baseVal.value - shape.x1.baseVal.value, 2) + Math.pow(shape.y2.baseVal.value - shape.y1.baseVal.value, 2));
	else if (shape.nodeName == "polyline")  for (i = 1; i < shape.points.numberOfItems; i++ ) { length += Math.sqrt(Math.pow(shape.points.getItem(i).x - shape.points.getItem(i-1).x, 2) + Math.pow(shape.points.getItem(i).y - shape.points.getItem(i-1).y, 2)); } 

	// get used markers
	var markerStartURL = window.getComputedStyle(shape).markerStart;
	var markerStartName = markerStartURL.substring(markerStartURL.lastIndexOf("#")+1).replace(")","").replace("\"","").replace("\"","");
	var markerStart = document.getElementById(markerStartName);
	var markerEndURL = window.getComputedStyle(shape).markerEnd;
	var markerEndName = markerEndURL.substring(markerEndURL.lastIndexOf("#")+1).replace(")","").replace("\"","").replace("\"","");
	var markerEnd = document.getElementById(markerEndName);

	// if length > 0 and some marker was used
	if (length > 0 && (markerStart || markerEnd)){


		var startWidth = markerStart ? parseFloat(markerStart.getAttribute("markerWidth")) : 0; 
		startWidth = startWidth > 10 ? startWidth - 10 : 0;
		var endWidth = markerEnd ? parseFloat(markerEnd.getAttribute("markerWidth")) : 0; 
		endWidth = endWidth > 10 ? endWidth - 10 : 0;

		var rest = length - startWidth - endWidth; 

		//console.log("\n"+shape.nodeName+":\t length: "+length+", startWidth: "+startWidth+", endWidth: "+endWidth+", rest: "+rest);

		var oldDashArray = window.getComputedStyle(shape).strokeDasharray.replace(/px/g,"").replace(/ /g,"").split(",");
		if (oldDashArray[0]=="none")
		{
			//            on         off              on            off
			var newDash = 0 + ", " + startWidth +"," + rest +", " + endWidth;
			shape.style.strokeDasharray = newDash;
			//console.log("new dash: " + newDash);
		}
		else
		{
			// 0 on, start marker width off
			var newDash = 0 + ", " + startWidth + ", ";
			// fill "rest" with old dash array, will start with an "on" value and end with an "off" value!
			var currentRest = 0;
			var on = false;	// track if current value is an on or off value
			while (currentRest<rest)
			{
				for (var i=0; i < oldDashArray.length && currentRest<rest; i++)
				{
					on = !on;
					var len = parseFloat(oldDashArray[i]);
					// does len fit?
					if (currentRest + len < rest)
					{
						newDash += len + ", ";
					}
					else // fill up
					{
						newDash += rest - currentRest+ ", ";
					}
					currentRest += len;
					// if not fitting
				}
			}
			// if end was not an off value, insert another:
			if (on) newDash += 0 + ", ";
			// 0 on, end marker width off
			newDash += 0 + ", " + endWidth;
			shape.style.strokeDasharray = newDash;
			//console.log("old dash: " + oldDashArray)
			//console.log("new dash: " + newDash);
		}
	}
}
